    @_UNIFFI_CALLBACK_INTERFACE_LOGGING_METHOD0
    def log(
            uniffi_handle,
            level,
            message,
            uniffi_out_return,
            uniffi_call_status_ptr,
        ):
        uniffi_obj = _UniffiConverterTypeLogging._handle_map.get(uniffi_handle)
        def make_call():
            args = (_UniffiConverterTypeLogLevel.lift(level), _UniffiConverterString.lift(message), )
            method = uniffi_obj.log
            return method(*args)

        
        write_return_value = lambda v: None
        _uniffi_trait_interface_call(
                uniffi_call_status_ptr.contents,
                make_call,
                write_return_value,
        )

    @_UNIFFI_CALLBACK_INTERFACE_FREE
    def _uniffi_free(uniffi_handle):
        _UniffiConverterTypeLogging._handle_map.remove(uniffi_handle)

    # Generate the FFI VTable.  This has a field for each callback interface method.
    _uniffi_vtable = _UniffiVTableCallbackInterfaceLogging(
        log,
        _uniffi_free
    )
    # Send Rust a pointer to the VTable.  Note: this means we need to keep the struct alive forever,
    # or else bad things will happen when Rust tries to access it.
    _UniffiLib.uniffi_lwk_fn_init_callback_vtable_logging(ctypes.byref(_uniffi_vtable))



