# LwkError
# We want to define each variant as a nested class that's also a subclass,
# which is tricky in Python.  To accomplish this we're going to create each
# class separately, then manually add the child classes to the base class's
# __dict__.  All of this happens in dummy class to avoid polluting the module
# namespace.
class LwkError(Exception):
    """
    Possible errors emitted
    """

    pass

_UniffiTempLwkError = LwkError

class LwkError:  # type: ignore
    """
    Possible errors emitted
    """

    class Generic(_UniffiTempLwkError):
        def __init__(self, msg):
            super().__init__(", ".join([
                "msg={!r}".format(msg),
            ]))
            self.msg = msg

        def __repr__(self):
            return "LwkError.Generic({})".format(str(self))
    _UniffiTempLwkError.Generic = Generic # type: ignore
    class PoisonError(_UniffiTempLwkError):
        def __init__(self, msg):
            super().__init__(", ".join([
                "msg={!r}".format(msg),
            ]))
            self.msg = msg

        def __repr__(self):
            return "LwkError.PoisonError({})".format(str(self))
    _UniffiTempLwkError.PoisonError = PoisonError # type: ignore
    class MagicRoutingHint(_UniffiTempLwkError):
        def __init__(self, address, amount, uri):
            super().__init__(", ".join([
                "address={!r}".format(address),
                "amount={!r}".format(amount),
                "uri={!r}".format(uri),
            ]))
            self.address = address
            self.amount = amount
            self.uri = uri

        def __repr__(self):
            return "LwkError.MagicRoutingHint({})".format(str(self))
    _UniffiTempLwkError.MagicRoutingHint = MagicRoutingHint # type: ignore
    class SwapExpired(_UniffiTempLwkError):
        def __init__(self, swap_id, status):
            super().__init__(", ".join([
                "swap_id={!r}".format(swap_id),
                "status={!r}".format(status),
            ]))
            self.swap_id = swap_id
            self.status = status

        def __repr__(self):
            return "LwkError.SwapExpired({})".format(str(self))
    _UniffiTempLwkError.SwapExpired = SwapExpired # type: ignore
    class NoBoltzUpdate(_UniffiTempLwkError):
        def __init__(self):
            pass

        def __repr__(self):
            return "LwkError.NoBoltzUpdate({})".format(str(self))
    _UniffiTempLwkError.NoBoltzUpdate = NoBoltzUpdate # type: ignore
    class ObjectConsumed(_UniffiTempLwkError):
        def __init__(self):
            pass

        def __repr__(self):
            return "LwkError.ObjectConsumed({})".format(str(self))
    _UniffiTempLwkError.ObjectConsumed = ObjectConsumed # type: ignore

LwkError = _UniffiTempLwkError # type: ignore
del _UniffiTempLwkError


class _UniffiConverterTypeLwkError(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return LwkError.Generic(
                _UniffiConverterString.read(buf),
            )
        if variant == 2:
            return LwkError.PoisonError(
                _UniffiConverterString.read(buf),
            )
        if variant == 3:
            return LwkError.MagicRoutingHint(
                _UniffiConverterString.read(buf),
                _UniffiConverterUInt64.read(buf),
                _UniffiConverterString.read(buf),
            )
        if variant == 4:
            return LwkError.SwapExpired(
                _UniffiConverterString.read(buf),
                _UniffiConverterString.read(buf),
            )
        if variant == 5:
            return LwkError.NoBoltzUpdate(
            )
        if variant == 6:
            return LwkError.ObjectConsumed(
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def check_lower(value):
        if isinstance(value, LwkError.Generic):
            _UniffiConverterString.check_lower(value.msg)
            return
        if isinstance(value, LwkError.PoisonError):
            _UniffiConverterString.check_lower(value.msg)
            return
        if isinstance(value, LwkError.MagicRoutingHint):
            _UniffiConverterString.check_lower(value.address)
            _UniffiConverterUInt64.check_lower(value.amount)
            _UniffiConverterString.check_lower(value.uri)
            return
        if isinstance(value, LwkError.SwapExpired):
            _UniffiConverterString.check_lower(value.swap_id)
            _UniffiConverterString.check_lower(value.status)
            return
        if isinstance(value, LwkError.NoBoltzUpdate):
            return
        if isinstance(value, LwkError.ObjectConsumed):
            return

    @staticmethod
    def write(value, buf):
        if isinstance(value, LwkError.Generic):
            buf.write_i32(1)
            _UniffiConverterString.write(value.msg, buf)
        if isinstance(value, LwkError.PoisonError):
            buf.write_i32(2)
            _UniffiConverterString.write(value.msg, buf)
        if isinstance(value, LwkError.MagicRoutingHint):
            buf.write_i32(3)
            _UniffiConverterString.write(value.address, buf)
            _UniffiConverterUInt64.write(value.amount, buf)
            _UniffiConverterString.write(value.uri, buf)
        if isinstance(value, LwkError.SwapExpired):
            buf.write_i32(4)
            _UniffiConverterString.write(value.swap_id, buf)
            _UniffiConverterString.write(value.status, buf)
        if isinstance(value, LwkError.NoBoltzUpdate):
            buf.write_i32(5)
        if isinstance(value, LwkError.ObjectConsumed):
            buf.write_i32(6)





