def derive_asset_id(txin: "TxIn",contract: "Contract") -> "AssetId":
    """
    Derive asset id from contract and transaction input
    """

    _UniffiConverterTypeTxIn.check_lower(txin)
    
    _UniffiConverterTypeContract.check_lower(contract)
    
    return _UniffiConverterTypeAssetId.lift(_uniffi_rust_call_with_error(_UniffiConverterTypeLwkError,_UniffiLib.uniffi_lwk_fn_func_derive_asset_id,
        _UniffiConverterTypeTxIn.lower(txin),
        _UniffiConverterTypeContract.lower(contract)))


